import React from 'react';
import HomeStyle from '../styles/home.style';


const Home = () => {
  return (
    <HomeStyle>
      <div className="Home">
      <header className="Home-header">
        <p>
          Welcome to FitBud
        </p>
      </header>
    </div> 
    </HomeStyle>
  );
}

export default Home;
